import axios from 'axios';
import React, { useEffect, useState } from 'react'

function Selectcar() {
    const [cars,setcars] = useState([]);
    useEffect(()=>{
        axios.get('http://localhost:8081/')
        .then(res=>setcars(res.data))
        .catch(err=>console.log("error"));
    })
  return (
    <div>
      Selectcar
    </div>
  )
}

export default Selectcar
